(AGI) - Milano, 6 mag. - A Milano &quot;per avere il voto&quot; dopo una sospensione di 12 anni dell'elettorato passivo per disobbedienza civile. Marco Pannella resta nella lista Bonino- Pannella ed e' quindi candidato al consiglio comunale di Milano. &quot;Sono stato riabilitato - ha detto Pannella - e sono in questa bellissima lista. Al penultimo posto perche' per l'ultimo mi ha fregato la Bonino&quot;. E proprio prendendo spunto dalla notizia della permanenza in lista di Pannella, Marco Cappato nel corso del suo intervento in piazza Duomo ha commentato: &quot;avremmo voluto dire ai milanesi che possono votare dopo 12 anni Marco Pannella, ma non abbiamo potuto farlo&quot;.
